import ReactDOM from "react-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./ttt.css"
import Header from "./Header";
import Game from "./Game";
import Footer from "./Footer";

ReactDOM.render(
  <Header />,
  <Game />,
  <Footer />,
  document.getElementById('root')
);
